    "2013-06-12T18:00:36.679039",nt"name": "hydrogeologic-map-of-minnesota-quaternary-hydrogeology-from-mgs-map-s-3-1979-digital-version",nt"isopen":
    false,nt"url": null,nt"notes": "These layers describe the geologic classification
    of the hydrogeologic, or water-bearing, units for the Quaternary (surficial, unconsolidated)
    deposits in Minnesota as delineated and classified by the Minnesota Geological Survey.
    They represent an automated version of the Minnesota Geological Survey State Map
    Series Map S-3 (Hydrogeologic Map of Minnesota: Quaternary Hydrogeology), 1979,
    by Roman Kanivetsky (1:500,000). The Quaternary Hydrogeology file was created by
    digitizing the the 1:500,000-scale paper map. The 'Quaternary Hydrogeology - Materials'
    and 'Quaternary Hydrogeology - Yield' layers were then created based on attributes
    assigned to the file. The Arc coverages were also converted into EPPL 40-acre grid
    cell files.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
